INSERT INTO `assignment_titles` VALUES (1,'Acting Commercial Agent',1040335078,1,0,NULL,'2009-03-17 21:05:40','2009-12-02 20:17:20'),(2,'Acting Consul',1040335078,1,0,NULL,'2009-03-17 21:05:40','2009-12-02 20:17:54'),(3,'Acting Consul General',1040335078,1,0,NULL,'2009-03-17 21:05:40','2009-12-02 20:18:24'),(4,'Acting Consular Agent',1040335078,1,0,NULL,'2009-03-17 21:05:40','2009-12-02 20:18:52'),(5,'Acting Vice Consul',1040335078,1,0,NULL,'2009-03-17 21:05:40','2009-12-02 20:19:15'),(6,'Acting Vice Consul in Charge',1040335078,1,0,'\"Acting\" typically denotes a temporary position, held until the official replacement arrives.  More research is necessary to find out why the one assignment for \"Acting Vice Consul in Charge\" lasted for 49 years.','2009-03-17 21:05:40','2009-12-02 20:22:32'),(7,'Agent for Claims and Seamen',1040335078,0,0,'Agents typically were not commissioned, however since only one person ever held this title more research is required.','2009-03-17 21:05:40','2009-12-02 20:23:47'),(8,'Agent for Commerce and Seamen',1040335078,0,0,NULL,'2009-03-17 21:05:40','2009-12-02 20:24:22'),(9,'Agent for Prisoners of War',1040335078,1,0,NULL,'2009-03-17 21:05:40','2012-09-10 20:49:36'),(10,'Chancellor of Consulate',854258232,0,0,NULL,'2009-03-17 21:05:40','2009-12-02 20:26:43'),(11,'Charge d\'Affaires',676005164,0,1,NULL,'2009-03-17 21:05:40','2010-09-16 18:55:21'),(12,'Charge d\'Affaires a.i.',676005164,1,0,'','2009-03-17 21:05:40','2012-10-09 20:20:44'),(13,'Clerk to Consul General',854258232,0,0,NULL,'2009-03-17 21:05:40','2009-12-02 20:29:29'),(14,'Commercial Agent',1040335078,0,1,'This title is a curious artifact of the Napoleonic Era. After Napoleon declared himself \"First Consul\" he required that foreign consuls be retitled in the French Empire.  The Convention of 1800, which ended the Quasi-War, renamed all American consuls in French held ports \"Commercial Agents.\"','2009-03-17 21:05:40','2013-04-19 02:38:17'),(15,'Commissioner',676005164,0,1,NULL,'2009-03-17 21:05:40','2009-12-02 20:30:56'),(16,'Commissioner (not COM)',676005164,0,1,NULL,'2009-03-17 21:05:40','2009-12-02 20:31:21'),(17,'Commissioner Plenipotentiary',676005164,0,1,'Research needed to verify commission.','2009-03-17 21:05:40','2009-12-02 20:32:44'),(18,'Consul',1040335078,0,1,NULL,'2009-03-17 21:05:40','2009-03-17 21:05:40'),(19,'Consul General',1040335078,0,1,NULL,'2009-03-17 21:05:40','2009-12-03 23:03:58'),(20,'Consul/ Claims Commissioner',1040335078,0,1,'Consuls were commissioned.','2009-03-17 21:05:40','2009-12-03 23:04:29'),(21,'Consular Agent',1040335078,0,0,'Even though this position has Agent in the title, it is clear from years served that this was a permanent position, since technically only American citizens could be commissioned as consuls (though there are many examples to the contrary).','2009-03-17 21:05:40','2012-09-10 20:56:48'),(22,'Consular and Commercial Agent',1040335078,0,0,NULL,'2009-03-17 21:05:40','2009-12-03 23:05:36'),(23,'Delegate U.S. Br. Commission',676005164,1,0,NULL,'2009-03-17 21:05:40','2009-12-03 23:06:17'),(24,'Diplomatic Agent',676005164,0,0,'This title appears to have only been used once -- for Charles Dumas.','2009-03-17 21:05:40','2012-09-10 20:57:43'),(25,'Envoy Extraordinaire and Minister Plenipotentiary',676005164,0,1,NULL,'2009-03-17 21:05:40','2009-12-03 23:07:07'),(26,'Minister Plenipotentiary',676005164,0,1,NULL,'2009-03-17 21:05:40','2009-12-03 23:07:31'),(27,'Minister Resident',676005164,0,1,'This appointment came one year after the Portuguese royal family moved to Brazil to escape Napoleon I and made Rio de Janeiro the temporary capital of the Portuguese Empire.','2009-03-17 21:05:40','2011-02-10 03:03:04'),(28,'Secretary of Delegation',854258232,0,0,NULL,'2009-03-17 21:05:40','2009-12-03 23:08:10'),(29,'Secretary of Legation',854258232,0,0,NULL,'2009-03-17 21:05:40','2009-12-03 23:08:36'),(30,'Secretary of Negotiating Delegation',854258232,0,0,NULL,'2009-03-17 21:05:40','2009-12-03 23:08:50'),(31,'Secretary to Consul General',854258232,0,0,NULL,'2009-03-17 21:05:40','2009-12-03 23:09:13'),(32,'Secretary to Negotiating Commission',854258232,0,0,NULL,'2009-03-17 21:05:40','2009-12-03 23:09:54'),(33,'Secretary to Negotiating Delegation',854258232,0,0,NULL,'2009-03-17 21:05:40','2009-12-03 23:10:37'),(34,'Secretary - Special Diplomatic Mission',854258232,1,0,NULL,'2009-03-17 21:05:40','2009-12-03 23:10:58'),(35,'Special Agent for Claims',1040335078,1,0,NULL,'2009-03-17 21:05:41','2009-12-03 23:11:12'),(36,'Special Agent to Portuguese Government',676005164,1,0,NULL,'2009-03-17 21:05:41','2010-01-10 22:15:28'),(37,'Special Agent/Commissioner',676005164,1,0,NULL,'2009-03-17 21:05:41','2009-12-03 23:11:54'),(38,'Special Commissioner',676005164,0,0,NULL,'2009-03-17 21:05:41','2009-12-03 23:12:13'),(39,'Special Diplomatic Agent',676005164,1,0,NULL,'2009-03-17 21:05:41','2010-01-10 22:22:24'),(40,'Special Negotiator',676005164,1,1,NULL,'2009-03-17 21:05:41','2012-09-10 21:00:19'),(41,'Treaty Negotiator',676005164,1,1,NULL,'2009-03-17 21:05:41','2012-09-10 21:01:18'),(42,'Vice /Acting Consul',1040335078,1,0,'It appears that those who held this position, were acting as consul while technically holding the position of vice consul (which was rarely a commissioned title).  More research is required into the particulars of each case.','2009-03-17 21:05:41','2009-12-03 23:15:49'),(43,'Vice Commercial Agent',1040335078,0,0,NULL,'2009-03-17 21:05:41','2009-12-03 23:16:13'),(44,'Vice Consul',1040335078,0,0,'Vice consul was typically an non commissioned post.  However, in some cases Vice Consuls were commissioned.  See the notes for each assignment record to determine if that officer held a commission as vice consul.','2009-03-17 21:05:41','2009-12-03 23:17:24'),(45,'Vice Consul in Charge',1040335078,0,0,NULL,'2009-03-17 21:05:41','2009-12-03 23:17:40');
